import React, { Component } from 'react';
import './UpcomingIPO.css';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import {Row,Col} from 'react-bootstrap';
import NavWithDropDownUser from '../UserNavBar';

class UpcomingIPO extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDownUser />
                <br></br>
                <br></br>
                <br></br>

                <Container id="main-upcoming-ipo">
                    <Card id="main-card-upipo">
                        <Card.Header>Upcoming IPO</Card.Header>
                        <Card.Body id="card-body-ipo-up">
                            <Col>
                            <Row md="1">
                                {this.displayData()}
                            </Row>
                            </Col>
                        </Card.Body>
                    </Card>
                </Container>
            </React.Fragment>
        );
    }
}

export default UpcomingIPO;
